def int_to_mini_roman(number):
    if not 0 < number < 1001:
        return "Number must be between 1 and 1000"

    roman_numerals_map = {
        1000: "m", 900: "cm", 500: "d", 400: "cd", 
        100: "c", 90: "xc", 50: "l", 40: "xl", 
        10: "x", 9: "ix", 5: "v", 4: "iv", 1: "i"
    }

    result = ""
    for value, numeral in roman_numerals_map.items():
        while number >= value:
            result += numeral
            number -= value

    return result.lower()
