def solve(s):
    letters = [char for char in s if char.isalpha()]
    if not letters:
        return s[::-1]
    else:
        new_s = ''
        for char in s:
            if char.isalpha():
                new_s += char.swapcase()
            else:
                new_s += char
        return new_s

